type UtilityDetails = {
  orderId?: string;
  requestId?: string;
  productName?: string;
  quantity?: number | string;
  network?: string;
  customerInfo?: string;
  billType?: string;
  paymentCurrency?: string;
  amount?: string | number;
  status?: string;
  date?: string;
  // Airtime specific
  phoneNumber?: string;
  serviceProvider?: string;
  // Data specific
  dataPlan?: string;
  validity?: string;
  // Electricity specific
  meterNumber?: string;
  customerName?: string;
  customerAddress?: string;
  token?: string;
  units?: string | number;
  // Cable TV specific
  smartCardNumber?: string;
  packageName?: string;
  // Betting specific
  betReference?: string;
  gameType?: string;
  betAmount?: string | number;
};

export type UtilityTransaction = {
  id: string;
  type: string;
  status: string;
  amount: string;
  date: string;
  details?: UtilityDetails;
};

// ---------- helpers ----------
const asText = (v: any) => {
  if (v === null || v === undefined) return '—';
  if (typeof v === 'number') return String(v);
  if (typeof v === 'string') return v.trim().length ? v : '—';
  return String(v);
};

const statusStyles = (status: string) => {
  const s = (status || '').toLowerCase();
  if (s === 'successful' || s === 'success')
    return { bg: '#E8F7EF', text: '#166534', border: '#BBE7CC' };
  if (s === 'failed' || s === 'error')
    return { bg: '#FDECEC', text: '#991B1B', border: '#F6CACA' };
  return { bg: '#FFF8E6', text: '#92400E', border: '#FBE1B3' };
};

const formatAmount = (amount?: string | number, currency?: string) => {
  if (amount === undefined || amount === null) return '—';
  const num = typeof amount === 'string' ? parseFloat(amount) : amount;
  if (isNaN(num)) return '—';
  const symbol = currency === 'NGNZ' ? '₦' : currency || '';
  return `${symbol}${num.toLocaleString('en-NG')}`;
};

const formatToken = (token?: string) => {
  if (!token) return '—';
  return token.replace(/(.{4})/g, '$1 ').trim();
};

const formatUnits = (units?: number | string) => {
  if (!units) return '—';
  const num = typeof units === 'string' ? parseFloat(units) : units;
  if (isNaN(num)) return '—';
  return `${num.toLocaleString()} kWh`;
};

const safeParseParam = (val?: string | string[]) => {
  if (!val) return undefined;
  const s = Array.isArray(val) ? val[0] : val;
  try {
    return JSON.parse(decodeURIComponent(s));
  } catch {
    try {
      return JSON.parse(s);
    } catch {
      return undefined;
    }
  }
};

