// ---------- screen ----------
export default function UtilityReceipt() {
  const router = useRouter();
  const params = useLocalSearchParams();
  const transaction = safeParseParam(params.tx) as UtilityTransaction | undefined;
  const [showCopied, setShowCopied] = useState(false);

  useEffect(() => {
    if (transaction) {
      console.log('📄 UtilityReceipt received:', {
        type: transaction.type,
        details: transaction.details,
        fullTransaction: JSON.stringify(transaction, null, 2)
      });
    }
  }, [transaction]);

  const s = statusStyles(transaction?.status || '');

  const handleCopy = (label: string, value?: string) => {
    if (!value) return;
    try {
      Clipboard.setString(value);
      setShowCopied(true);
    } catch {
      Alert.alert('Copy failed', `Unable to copy ${label.toLowerCase()}`);
    }
  };

  const onShare = async () => {
    try {
      if (!transaction) {
        Alert.alert('Error', 'No transaction data to share');
        return;
      }

      const htmlContent = generateUtilityReceiptHTML(
        transaction, 
        transaction.details || {}, 
        s
      );

      const { uri } = await Print.printToFileAsync({
        html: htmlContent,
        width: 612,
        height: 792,
        base64: false,
      });

      if (!uri) throw new Error('Failed to generate PDF');

      const sharingAvailable = await Sharing.isAvailableAsync();
      if (sharingAvailable) {
        await Sharing.shareAsync(uri, {
          mimeType: 'application/pdf',
          dialogTitle: 'Share Utility Receipt',
          UTI: 'com.adobe.pdf',
        });
        return;
      }

      await Share.share({
        title: 'Utility Receipt',
        message: 'Utility receipt attached.',
        url: Platform.OS === 'ios' ? uri : `file://${uri}`,
      });
    } catch (error) {
      console.error('PDF generation error:', error);
      Alert.alert('Share failed', 'Could not generate PDF receipt. Please try again.');
    }
  };

  if (!transaction) {
    return (
      <SafeAreaView style={styles.container}>
        <View style={styles.header}>
          <TouchableOpacity 
            style={styles.backButton} 
            onPress={() => router.back()}
            activeOpacity={0.7}
            delayPressIn={0}
            hitSlop={{ top: 15, bottom: 15, left: 15, right: 15 }}
          >
            <Image source={backIcon} style={styles.backIcon} />
          </TouchableOpacity>
          <Image source={successImage} style={styles.headerLogo} resizeMode="contain" />
          <View style={styles.headerRight} />
        </View>
        <View style={[styles.centerContent, { padding: 24 }]}>
          <Text style={styles.emptyTitle}>No transaction selected</Text>
          <View style={styles.ctaRow}>
            <TouchableOpacity
              style={styles.primaryButton}
              onPress={() => router.back()}
              activeOpacity={0.95}
            >
              <Text style={styles.primaryButtonText}>Done</Text>
            </TouchableOpacity>
            <TouchableOpacity style={styles.secondaryButton} onPress={onShare} activeOpacity={0.85}>
              <Text style={styles.secondaryButtonText}>Share</Text>
            </TouchableOpacity>
          </View>
        </View>
      </SafeAreaView>
    );
  }

  const details = transaction.details || {};

  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity 
          style={styles.backButton} 
          onPress={() => router.back()}
          activeOpacity={0.7}
          delayPressIn={0}
          hitSlop={{ top: 15, bottom: 15, left: 15, right: 15 }}
        >
          <Image source={backIcon} style={styles.backIcon} />
        </TouchableOpacity>
        <Image source={successImage} style={styles.headerLogo} resizeMode="contain" />
        <View style={styles.headerRight} />
      </View>

      <ScrollView
        style={styles.scroll}
        contentContainerStyle={styles.scrollContent}
        showsVerticalScrollIndicator={false}
      >
        <View style={styles.amountRow}>
          <Text style={styles.amountText} numberOfLines={1}>
            {transaction.amount}
          </Text>
        </View>

        <View style={styles.centeredStatus}>
          <View style={[styles.statusPill, { backgroundColor: s.bg, borderColor: s.border }]}>
            <Text style={[styles.statusPillText, { color: s.text }]} numberOfLines={1}>
              {transaction.status}
            </Text>
          </View>
        </View>

        <View style={styles.detailsCard}>
          <Row label="Type" value={asText(transaction.type)} />
          <Row label="Date" value={asText(transaction.date)} />
          <Row 
            label="Order ID" 
            value={asText(details.orderId)} 
            copyableValue={details.orderId}
            onCopy={(v) => handleCopy('Order ID', v)}
          />
          <Row label="Product" value={asText(details.productName)} />
          
          {/* Airtime specific fields */}
          {details.phoneNumber && (
            <Row 
              label="Phone Number" 
              value={asText(details.phoneNumber)}
              copyableValue={details.phoneNumber}
              onCopy={(v) => handleCopy('Phone Number', v)}
            />
          )}
          {details.serviceProvider && (
            <Row label="Service Provider" value={asText(details.serviceProvider)} />
          )}
          
          {/* Data specific fields */}
          {details.dataPlan && (
            <Row label="Data Plan" value={asText(details.dataPlan)} />
          )}
          {details.validity && (
            <Row label="Validity" value={asText(details.validity)} />
          )}
          
          {/* Electricity specific fields */}
          {details.meterNumber && (
            <Row 
              label="Meter Number" 
              value={asText(details.meterNumber)}
              copyableValue={details.meterNumber}
              onCopy={(v) => handleCopy('Meter Number', v)}
            />
          )}
          {details.customerName && (
            <Row label="Customer Name" value={asText(details.customerName)} />
          )}
          {details.customerAddress && (
            <Row label="Address" value={asText(details.customerAddress)} />
          )}
          {details.token && (
            <Row 
              label="Token" 
              value={formatToken(details.token)}
              copyableValue={details.token}
              onCopy={(v) => handleCopy('Token', v)}
            />
          )}
          {details.units && (
            <Row label="Units" value={formatUnits(details.units)} />
          )}
          
          {/* Cable TV specific fields */}
          {details.smartCardNumber && (
            <Row 
              label="Smart Card" 
              value={asText(details.smartCardNumber)}
              copyableValue={details.smartCardNumber}
              onCopy={(v) => handleCopy('Smart Card', v)}
            />
          )}
          {details.packageName && (
            <Row label="Package" value={asText(details.packageName)} />
          )}
          
          {/* Betting specific fields */}
          {details.betReference && (
            <Row 
              label="Bet Reference" 
              value={asText(details.betReference)}
              copyableValue={details.betReference}
              onCopy={(v) => handleCopy('Bet Reference', v)}
            />
          )}
          {details.gameType && (
            <Row label="Game Type" value={asText(details.gameType)} />
          )}
          {details.betAmount && (
            <Row 
              label="Bet Amount" 
              value={formatAmount(details.betAmount, details.paymentCurrency)} 
            />
          )}
          
          <Row label="Network" value={asText(details.network)} />
          <Row label="Payment Currency" value={asText(details.paymentCurrency)} />
        </View>

        <View style={styles.footerMessage}>
          <Text style={styles.footerText}>Thank you for choosing ZeusODX.</Text>
        </View>

        <View style={styles.ctaRow}>
          <TouchableOpacity
            style={styles.primaryButton}
            onPress={() => router.back()}
            activeOpacity={0.95}
          >
            <Text style={styles.primaryButtonText}>Done</Text>
          </TouchableOpacity>
          <TouchableOpacity style={styles.secondaryButton} onPress={onShare} activeOpacity={0.85}>
            <Text style={styles.secondaryButtonText}>Share</Text>
          </TouchableOpacity>
        </View>
      </ScrollView>
      
      {/* AddressCopied notification */}
      {showCopied && (
        <AddressCopied
          onDismiss={() => setShowCopied(false)}
          autoHide={true}
          duration={1800}
        />
      )}
    </SafeAreaView>
  );
}

function Row({
  label,
  value,
  copyableValue,
  onCopy,
}: {
  label: string;
  value: string;
  copyableValue?: string;
  onCopy?: (val: string) => void;
}) {
  return (
    <View style={styles.row}>
      <Text style={styles.rowLabel} numberOfLines={1}>
        {label}
      </Text>
      <View style={styles.rowValueWrap}>
        <Text style={styles.rowValue} numberOfLines={1}>
          {value}
        </Text>
        {copyableValue ? (
          <TouchableOpacity
            style={styles.copyButton}
            onPress={() => onCopy && onCopy(copyableValue)}
            activeOpacity={0.8}
          >
            <Image
              source={require('./icons/copy-icon.png')}
              style={styles.copyIcon}
              resizeMode="cover"
            />
          </TouchableOpacity>
        ) : null}
      </View>
    </View>
  );
}

